import React from "react";
import "./Home.css";

const Home = () => {
  const navBar = [
    {
      type: "Stays",
      icon: "fa-bed",
      active: true,
    },
    {
      type: "Flights",
      icon: "fa-plane",
      active: false,
    },
    {
      type: "Car rentals",
      icon: "fa-car",
      active: false,
    },
    {
      type: "Attractions",
      icon: "fa-bed",
      active: false,
    },
    {
      type: "Airport taxis",
      icon: "fa-taxi",
      active: false,
    },
  ];

  return (
    <div>
      <h1>Home Page</h1>
      <header className="header">
        <div>
          <h2>Booking Website</h2>
          <div>
            <button>Register</button>
            <button>Login</button>
          </div>
        </div>
        <div></div>
      </header>
    </div>
  );
};

export default Home;
